import { StyledLivro } from "./styles/Livro.Styled"
export default function Livro({livro}){

    console.log(livro)

    return(

            <StyledLivro>
                <img src="{'./' + livro.img_path}"/>
                <h4>Titulo</h4>
                <p>{livro.titulo}</p>
                <h4>Autor</h4>
                <p>{livro.autor}</p>

            </StyledLivro>



    )





}
